yourQH is a specialist outpatient appointment management, referral and correspondence portal for patients, families and carers of Queensland Health Hospital and Health Services. yourQH will benefit current or future patients and families receiving specialist outpatient and/or community health service care within Queensland.

In yourQH, you will be able to view and request changes to your specialist outpatient and community appointments. You will also be able to:
* view referral information;
* view future and past appointments;
* request to reschedule an appointment (and provide most suitable days and times);
* request to cancel an appointment or referral;
* confirm you are able to attend an appointment;
* check in to appointments (when you arrive at the location);
* share your appointment information by inviting other users;
* submit a query to clinic staff about your appointment or referral;
* update personal, contact and financial information;
* provide consent about how the Hospital and Health Service can use your information (such as contact you for research or marketing), and;
* view Hospital and Health Service information such as what to bring to your appointment.
